Hi Frank just did a little quick & I hear after this is &quot;That&#39;s nice.
Isn&#39;t she pretty? They&#39;ve been together forever&quot;

Andrea
-----Original Message-----
From: EVP-ITC@yahoogroups.com [mailto:EVP-ITC@yahoogroups.com] On Behalf
Of Sumption Frank
Sent: Tuesday, June 27, 2006 8:21 AM
To: EVP-ITC@yahoogroups.com
Subject: [EVP-ITC] More voices from the 18th.

In #75, that my wife they are talking about. In #78, a pencil is what my
guys call a computer.

 Frank



